description:
Telltale Games turns Spielberg's classic dinosaur movie Jurassic Park into an episodic adventure. Relive some of your fondest dinosaur memories with this new version of Jurassic Park: The Game. You will be able to experience the same feeling you got when watching the movie. Survive the obstacles and the dinosaurs ahead of you as you try to navigate through the park toward safety. Jurassic Park: The Game features the unforgettable tyrannosaurus rex, velociraptors, and a brand new dinosaur that you have never seen before. Return to the park located on Isla Nublar with this new version of the iconic Jurassic Park movie.

